import{_ as a}from"./chunks/v5_nano_01.DMHbymF9.js";import{_ as o,a as r,b as l,c as i,d as e,e as n,f as s}from"./chunks/v5_nano_pinouts.TtGHIgB6.js";import{_ as c,c as d,a8 as h,o as u}from"./chunks/framework.BDnHobkS.js";const P=JSON.parse('{"title":"雷迅CUAV V5 nano飞控接线快速入门","description":"","frontmatter":{},"headers":[],"relativePath":"zh/assembly/quick_start_cuav_v5_nano.md","filePath":"zh/assembly/quick_start_cuav_v5_nano.md"}'),p={name:"zh/assembly/quick_start_cuav_v5_nano.md"};function m(f,t,g,b,y,_){return u(),d("div",null,t[0]||(t[0]=[h('<h1 id="雷迅cuav-v5-nano飞控接线快速入门" tabindex="-1">雷迅CUAV V5 nano飞控接线快速入门 <a class="header-anchor" href="#雷迅cuav-v5-nano飞控接线快速入门" aria-label="Permalink to &quot;雷迅CUAV V5 nano飞控接线快速入门&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 does not manufacture this (or any) autopilot. Contact the <a href="https://store.cuav.net/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p>This quick start guide shows how to power the <a href="./../flight_controller/cuav_v5_nano.html">CUAV V5 nano</a> flight controller and connect its most important peripherals.</p><p><img src="'+a+'" alt="Nano Hero Image"></p><h2 id="接线图概述" tabindex="-1">接线图概述 <a class="header-anchor" href="#接线图概述" aria-label="Permalink to &quot;接线图概述&quot;">​</a></h2><p>下图展示了如何连接最重要的传感器和外围设备（电机和伺服舵机输出除外）。 我们将在下面各节中介绍它们的细节。</p><p><img src="'+o+'" alt="quickstart"></p><table tabindex="0"><thead><tr><th style="text-align:left;">主要接口</th><th style="text-align:left;">功能</th></tr></thead><tbody><tr><td style="text-align:left;">电源</td><td style="text-align:left;">连接电源模块；提供能量、模拟电压和电流测量。</td></tr><tr><td style="text-align:left;">PM2</td><td style="text-align:left;"><a href="./../flight_controller/cuav_v5_nano.html#compatibility_pm2">Do not use with PX4</a></td></tr><tr><td style="text-align:left;">TF CARD</td><td style="text-align:left;">用于日志存储的SD卡（随卡提供）</td></tr><tr><td style="text-align:left;">M1~M8</td><td style="text-align:left;">PWM 输出接口。 可以使用它控制电机或舵机。</td></tr><tr><td style="text-align:left;">A1~A3</td><td style="text-align:left;">Capture pins (not <em>currently</em> supported on PX4).</td></tr><tr><td style="text-align:left;">nARMED</td><td style="text-align:left;">表示 FMU 处于待命状态。 低电平时表示激活（待命时是低电平）。</td></tr><tr><td style="text-align:left;">DSU7</td><td style="text-align:left;">用于 FMU 调试，读取调试信息。</td></tr><tr><td style="text-align:left;">I2C2/I2C3/I2C4</td><td style="text-align:left;">连接I2C总线设备；比如外部的罗盘。</td></tr><tr><td style="text-align:left;">CAN1/CAN2</td><td style="text-align:left;">用于连接 UAVCAN 设备，比如 CAN GPS。</td></tr><tr><td style="text-align:left;">TYPE-C(USB)</td><td style="text-align:left;">连接到计算机，以便在飞控和计算机之间进行通信，例如加载固件。</td></tr><tr><td style="text-align:left;">GPS&amp;SAFETY</td><td style="text-align:left;">连接到 Neo GPS，其中包括GPS、安全开关、蜂鸣器接口。</td></tr><tr><td style="text-align:left;">TELEM1/TELEM2</td><td style="text-align:left;">连接到数传电台</td></tr><tr><td style="text-align:left;">DSM/SBUS/RSSI</td><td style="text-align:left;">包含DSM、SBUS、RSSI信号输入接口；DSM接口可以连接DSM卫星接收机，SBUS接口可以连接SBUS总线的遥控器接收机，RSSI连接RSSI信号强度回传模块。</td></tr></tbody></table><div class="info custom-block"><p class="custom-block-title">INFO</p><p>For more interface information, please read <a href="http://manual.cuav.net/V5-nano.pdf" target="_blank" rel="noreferrer">V5 nano Manual</a>.</p></div><p><img src="'+r+'" alt="quickstart"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>If the controller cannot be mounted in the recommended/default orientation (e.g. due to space constraints) you will need to configure the autopilot software with the orientation that you actually used: <a href="./../gps_compass/rtk_gps.html">Flight Controller Orientation</a>.</p></div><h2 id="gps-罗盘-安全开关-led" tabindex="-1">GPS + 罗盘 + 安全开关 + LED <a class="header-anchor" href="#gps-罗盘-安全开关-led" aria-label="Permalink to &quot;GPS + 罗盘 + 安全开关 + LED&quot;">​</a></h2><p>The recommended GPS module is the <em>Neo v2 GPS</em>, which contains GPS, compass, safety switch, buzzer, LED status light.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Other GPS modules may not work (see <a href="./../flight_controller/cuav_v5_nano.html#compatibility_gps">this compatibility issue</a>).</p></div><p>The GPS/Compass module should be <a href="./../assembly/mount_gps_compass.html">mounted on the frame</a> as far away from other electronics as possible, with the direction marker towards the front of the vehicle (Neo GPS arrow is in the same direction as the flight control arrow). Connect to the flight control GPS interface using a cable.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>If you use CAN GPS, please use the cable to connect to the flight control CAN interface.</p></div><p><img src="'+l+'" alt="quickstart"></p><h2 id="安全开关" tabindex="-1">安全开关 <a class="header-anchor" href="#安全开关" aria-label="Permalink to &quot;安全开关&quot;">​</a></h2><p>The dedicated safety switch that comes with the V5+ is only required if you are not using the recommended <em>Neo v2 GPS</em> (which has an inbuilt safety switch).</p><p>If you are flying without the GPS you must attach the switch directly to the <code>GPS1</code> port in order to be able to arm the vehicle and fly (If you use the old 6-pin GPS, please read the definition of the bottom interface to change the line).</p><h2 id="蜂鸣器" tabindex="-1">蜂鸣器 <a class="header-anchor" href="#蜂鸣器" aria-label="Permalink to &quot;蜂鸣器&quot;">​</a></h2><p>If you do not use the recommended <em>Neo v2 GPS</em> the buzzer may not work.</p><h2 id="遥控器" tabindex="-1">遥控器 <a class="header-anchor" href="#遥控器" aria-label="Permalink to &quot;遥控器&quot;">​</a></h2><p>A remote control (RC) radio system is required if you want to manually control your vehicle (PX4 does not require a radio system for autonomous flight modes). 将 <em>HW\\u PM</em> 模块的6针连接器连接到飞控的<code>电源</code>接口。</p><p>The figure below shows how you can access your remote receiver (please find the S.Bus cable in the kit)</p><p><img src="'+i+'" alt="quickstart"></p><h2 id="spektrum-卫星接收器" tabindex="-1">Spektrum 卫星接收器 <a class="header-anchor" href="#spektrum-卫星接收器" aria-label="Permalink to &quot;Spektrum 卫星接收器&quot;">​</a></h2><p>通信频道是通过数传无线电实现的。 If using a Spektrum satellite receiver, this should be connected to the flight controller <code>DSM/SBUS/RSSI</code> interface.</p><h2 id="电源" tabindex="-1">电源 <a class="header-anchor" href="#电源" aria-label="Permalink to &quot;电源&quot;">​</a></h2><p>The <em>v5 nano</em> kit includes the <em>HV_PM</em> module, which supports 2~14S LiPo batteries. Connect the 6pin connector of the <em>HW_PM</em> module to the flight control <code>Power</code> interface.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>The supplied power module is unfused. Power <strong>must</strong> be turned off while connecting peripherals.</p></div><p><img src="'+e+'" alt="quickstart"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The power module is not a power source for peripherals connected to the PWM outputs. If you&#39;re connecting servos/actuators you will need to separately power them using a BEC.</p></div><h2 id="数传系统-可选" tabindex="-1">数传系统（可选） <a class="header-anchor" href="#数传系统-可选" aria-label="Permalink to &quot;数传系统（可选）&quot;">​</a></h2><p>A telemetry system allows you to communicate with, monitor, and control a vehicle in flight from a ground station (for example, you can direct the UAV to a particular position, or upload a new mission).</p><p>The communication channel is via Telemetry Radios. The vehicle-based radio should be connected to the <strong>TELEM1</strong> or <strong>TELEM2</strong> port (if connected to these ports, no further configuration is required). The other radio is connected to your ground station computer or mobile device (usually via USB).</p><p><img src="'+n+'" alt="quickstart"></p><p><a id="sd_card"></a></p><h2 id="sd-卡" tabindex="-1">SD 卡 <a class="header-anchor" href="#sd-卡" aria-label="Permalink to &quot;SD 卡&quot;">​</a></h2><p>An <a href="./../getting_started/px4_basic_concepts.html#sd-cards-removable-memory">SD card</a> is inserted in the factory (you do not need to do anything).</p><h2 id="电机" tabindex="-1">电机 <a class="header-anchor" href="#电机" aria-label="Permalink to &quot;电机&quot;">​</a></h2><p>Motors/servos are connected to the MAIN ports in the order specified for your vehicle in the <a href="./../airframes/airframe_reference.html">Airframes Reference</a>.</p><p><img src="'+e+'" alt="quickstart"></p><h2 id="针脚定义" tabindex="-1">针脚定义 <a class="header-anchor" href="#针脚定义" aria-label="Permalink to &quot;针脚定义&quot;">​</a></h2><p><img src="'+s+'" alt="V5 nano pinouts"></p><h2 id="更多信息" tabindex="-1">更多信息 <a class="header-anchor" href="#更多信息" aria-label="Permalink to &quot;更多信息&quot;">​</a></h2><ul><li><a href="./../frames_multicopter/dji_f450_cuav_5nano.html">Airframe buildlog using CUAV v5 nano on a DJI FlameWheel450</a></li><li><a href="./../flight_controller/cuav_v5_nano.html">CUAV V5 nano</a></li><li><a href="http://manual.cuav.net/V5-nano.pdf" target="_blank" rel="noreferrer">V5 nano manual</a> (CUAV)</li><li><a href="https://docs.google.com/spreadsheets/d/1-n0__BYDedQrc_2NHqBenG1DNepAgnHpSGglke-QQwY/edit#gid=912976165" target="_blank" rel="noreferrer">FMUv5 reference design pinout</a> (CUAV)</li><li><a href="https://github.com/cuav" target="_blank" rel="noreferrer">CUAV Github</a> (CUAV)</li></ul>',47)]))}const x=c(p,[["render",m]]);export{P as __pageData,x as default};
